function compute(input, w, b)
{
		var out = [];
		for (var i = 0; i < w.length; i++)
		{
		  out[i] = b[i];
		  for (var j = 0; j < w[i].length; j++)
			{
		    out[i] += input[j] * w[i][j];
		  }
		  out[i] = sigmoid(out[i]);
		}

		// compute final output
		var max = out.reduce(
			function(p, c)
			{
				return p > c ? p : c;
			});
		var nominators = out.map(
			function(e)
			{
				return Math.exp(e - max);
			});
		var denominator = nominators.reduce(
			function (p, c)
			{
				return p + c;
			});
		var output = nominators.map(
			function(e)
			{
				return e/denominator;
			});

		return output;
}

function sigmoid(z)
{
    return 1/(1 + Math.exp(-z));
}

